import './NavBar.css';

import React from "react";
import {EquinorIcon, Icon} from '../../assets/svg/EquinorIcon';
import styled from 'styled-components';

const NavBarStyled = styled.nav`
  display: flex;
  flex-direction: row;
  width: 100%;
  background: #FFFFFF;
  float: left;
  height: 64px;
  border-bottom: 2px solid #f7f7f7;
`;

export const NavBar = () => {
  return (
    <div className="NavBar">
      <div className="left">
        <EquinorIcon icon={Icon.MENU}/>
        <span>Neqsim</span>
      </div>
      <div className="right">
        <EquinorIcon icon={Icon.USER}/>
      </div>
    </div>
  );
};
